import Navbar from './components/navbar';
import BusCard from './components/BusCard';
import HomePage from './HomePage';

const Home =()=>{
    return (
        <div>
            <Navbar></Navbar>
            <BusCard></BusCard>
            <HomePage></HomePage>
        </div>
    )
}

export default Home;
